script: |
  super -f text -I q13665.spq | sort > q13665.out

inputs:
  - name: q13665.spq
    data: |
      SELECT DISTINCT + - col0 FROM tab0 (FORMAT parquet) WHERE NOT col2 BETWEEN ( + - col2 ) * 49 + - - col1 AND 3;
  - name: tab0

outputs:
  - name: q13665.out
    data: |
      -15
      -87
      -97
